import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { FormsModule } from '@angular/forms';  // Ajoute cet import

import { AdminContenerComponent } from './admin-contener/admin-contener.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { DashboardSlideComponent } from './dashboard-slide/dashboard-slide.component';

@NgModule({
  declarations: [
    AdminContenerComponent,
    DashboardComponent,
    DashboardSlideComponent
  ],
  imports: [
    CommonModule,
    RouterModule,
    FormsModule  // Ajoute FormsModule à la section imports
  ],
  exports: [
    AdminContenerComponent,
    DashboardComponent,
    DashboardSlideComponent 
  ]
})
export class AdminModule { }
